import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function QuizResultado() {
  const { user_id } = useParams();
  const [resultado, setResultado] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchResultado = async () => {
      try {
        const response = await fetch(`http://localhost:3000/quizresultado/${user_id}`);

        if (!response.ok) {
          throw new Error("Nenhum resultado encontrado");
        }

        const data = await response.json();
        setResultado(data);
      } catch (error) {
        console.error("Erro ao carregar resultado:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchResultado();
  }, [user_id]);

  if (loading) {
    return <h2>Carregando resultado...</h2>;
  }

  if (!resultado) {
    return <h2>Nenhum resultado encontrado.</h2>;
  }

  return (
    <div style={{ padding: "20px" }}>
      <h1>{resultado.result_title}</h1>
      <p>{resultado.result_text}</p>

      <h3>Pontuação total: {resultado.total_score}</h3>

      <hr />

      <h3>Detalhes salvos:</h3>
      <pre>{JSON.stringify(resultado, null, 2)}</pre>
    </div>
  );
}
